import React, { useState } from 'react';
import './Table.css';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

const mockPatients = [
  {
    HN: 'AI12345',
    prefix: 'Mr.',
    name: 'John',
    surname: 'Doe',
    gender: 'Male',
    DOB: '1990-01-01',
    records: [
      {
        id: 'rec1',
        timestamp: '2024-08-09T14:39:25.853Z',
        details: 'Details for John Record 1',
      },
      {
        id: 'rec2',
        timestamp: '2024-08-09T15:39:25.853Z',
        details: 'Details for John Record 2',
      },
      {
        id: 'rec3',
        timestamp: '2024-08-09T16:39:25.853Z',
        details: 'Details for John Record 3',
      },
    ],
  },
  {
    HN: 'AI12346',
    prefix: 'Ms.',
    name: 'Jane',
    surname: 'Smith',
    gender: 'Female',
    DOB: '1992-02-02',
    records: [
      {
        id: 'rec4',
        timestamp: '2024-08-10T14:39:25.853Z',
        details: 'Details for Jane Record 1',
      },
      {
        id: 'rec5',
        timestamp: '2024-08-10T15:39:25.853Z',
        details: 'Details for Jane Record 2',
      },
      {
        id: 'rec6',
        timestamp: '2024-08-10T16:39:25.853Z',
        details: 'Details for Jane Record 3',
      },
    ],
  },
];

const TableComponent = ({ setSelectedSidebarItem }) => {
  const [expandedRow, setExpandedRow] = useState(null);

  const toggleRow = (index) => {
    setExpandedRow(expandedRow === index ? null : index);
  };

  return (
    <div className="container-table">
      <div className="header-container">
        <div className="header-left">
          <div className="header-title">All Customers</div>
          <div className="header-link">Active Members</div>
        </div>
        <div className="header-right">
          <input
            type="text"
            className="search-input"
            placeholder="Search by Name or Hospital Number"
          />
          <button
            className="new-pt-button"
            onClick={() => setSelectedSidebarItem('Form')}
          >
            New PT
          </button>
        </div>
      </div>

      <TableContainer component={Paper}>
        <Table className="Table">
          <TableHead>
            <TableRow>
              <TableCell>Hospital Number</TableCell>
              <TableCell>Customer Name</TableCell>
              <TableCell>Date of Birth</TableCell>
              <TableCell>Gender</TableCell>
              <TableCell>Details</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {mockPatients.map((patient, index) => (
              <React.Fragment key={index}>
                <TableRow>
                  <TableCell>{patient.HN}</TableCell>
                  <TableCell>{`${patient.prefix} ${patient.name} ${patient.surname}`}</TableCell>
                  <TableCell>{patient.DOB}</TableCell>
                  <TableCell>{patient.gender}</TableCell>
                  <TableCell>
                    <button onClick={() => toggleRow(index)}>
                      {expandedRow === index ? 'Hide Details' : 'Show Details'}
                    </button>
                  </TableCell>
                </TableRow>
                {expandedRow === index &&
                  patient.records.map((record) => (
                    <TableRow key={record.id} className="sub-row">
                      <TableCell colSpan={2}></TableCell>
                      <TableCell>{record.timestamp}</TableCell>
                      <TableCell>{patient.name}</TableCell>
                      <TableCell>
                        <a href={`/details/${record.id}`}>More Details</a>
                      </TableCell>
                    </TableRow>
                  ))}
              </React.Fragment>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
};

export default TableComponent;
